INSERT INTO events VALUES('cm1uv46ns000512gi0vqndymk','2024-10-04T15:10:41.080+00:00','2024-10-04T15:10:41.080+00:00','AXCN: Mobile Suit Gundam II: Soldiers of Sorrow','https://www.iconicreleasing.com/events/mobile-suit-gundam-2/tickets/','With evacuees from Side 7 onboard, the White Base crosses the Pacific Ocean and heads west towards the continent of Eurasia. Amidst that journey filled with battle, Amuro has a fight with Bright and runs away, suffering from the deaths of Matilda, who he had feelings for, and Ryu, who was like a big brother to him.','https://d2alu56i91c6gw.cloudfront.net/iconicreleasing/GUNDAM2_720x1015_A1.jpg','2024-10-16T00:00:00+00:00');
