INSERT INTO events VALUES('cm1uv46sv000712gigf5s5m2i','2024-10-04T15:10:41.264+00:00','2024-10-04T15:10:41.264+00:00','Howl’s Moving Castle (Studio Ghibli 2024)','https://www.fathomevents.com/events/howls-moving-castle-20th-anniversary-studio-ghibli-fest-2024/','That jumbled piece of architecture, that cacophony of hissing steam and creaking joints, with smoke billowing from it as it moves on its own... That castle is home to the magnificent wizard Howl, infamous for both his magical prowess and for being a womanizer—or so the rumor goes in Sophie Hatter''s small town. Sophie, as the plain daughter of a hatmaker, does not expect much from her future and is content with working hard in the shop.','https://yattatachi.com/wp-content/uploads/2021/06/howls-moving-castle-movie-poster.jpg','2024-09-26T00:00:00+00:00');
INSERT INTO events VALUES('cm1uv46w1000812gip4pf9t77','2024-10-04T15:10:41.377+00:00','2024-10-04T15:10:41.377+00:00','Look Back','https://www.fandango.com/look-back-2024-237527/movie-overview','Fourth-grader Ayumu Fujino regularly draws four-panel manga for her school newspaper and is lauded as having the best artwork in her class. One day, she is asked by her teacher to turn over one of her manga slots in the school newspaper to a truant student named Kyomoto. When Kyomoto''s manga pops up alongside Fujino''s, it receives high praises for its detailed artwork, making Fujino furiously jealous.','https://yattatachi.com/wp-content/uploads/2024/08/Look-Back-Gkids-Poster-551x768.jpg','2024-10-03T00:00:00+00:00');
INSERT INTO events VALUES('cm1uv46yf000912gi3le9g4p7','2024-10-04T15:10:41.464+00:00','2024-10-04T15:10:41.464+00:00','Bocchi the Rock! Recap Part 1','https://www.fandango.com/bocchi-the-rock-2024-237886/movie-overview','BOCCHI THE ROCK! tells the story of young rocker Hitori Gotoh, also known as "Bocchi-chan," a middle schooler struggling with social anxiety. Amid her silence and solitude, she picks up a guitar and discovers that she is talented, but despite spending hours practicing and uploading popular videos of herself performing, her dreams of joining a band and making friends never materialize.','https://yattatachi.com/wp-content/uploads/2024/06/bocchi-the-rock-recap-poster-518x768.webp','2024-10-06T00:00:00+00:00');
