INSERT INTO events VALUES('cm1uv475w000c12giov0sqrd2','2024-10-04T15:10:41.732+00:00','2024-10-04T15:10:41.732+00:00','Kiki’s Delivery Service (Studio Ghibli Fest 2024)','https://www.dpbolvw.net/click-9117960-10369449?url=https%3A%2F%2Fwww.fandango.com%2Fkikis-delivery-service-35th-anniversary-studio-ghibli-fest-2024-235296%2Fmovie-overview','Kiki, a 13-year-old witch-in-training, must spend a year living on her own in a distant town in order to become a full-fledged witch. Leaving her family and friends, Kiki undertakes this tradition when she flies out into the open world atop her broomstick with her black cat Jiji.','https://yattatachi.com/wp-content/uploads/2019/02/kiki-delivery-service-poster-547x768.jpg','2024-10-26T00:00:00+00:00');
