INSERT INTO events VALUES('cm1uv47eh000f12gie090xn8y','2024-10-04T15:10:42.041+00:00','2024-10-04T15:10:42.041+00:00','Pom Poko – 30th Anniversary (Studio Ghibli Fest 2024)','https://www.kqzyfj.com/click-9117960-10369449?url=https%3A%2F%2Fwww.fandango.com%2Fpom-poko-30th-anniversary-studio-ghibli-fest-2024-235297%2Fmovie-overview','With the increasing need for Tokyo to expand as one of Japan''s major cities, inevitable sacrifices must be made so that changes can take place. One of these sacrifices is that the room for nature and wildlife to flourish will decrease significantly over time. As this decline continues, many animal communities experience the brunt of urbanization. One such community known as the "Tanuki," a type of magical shape-shifting mammal, is caught up in a struggle to defend their beloved forest from being absorbed by the looming threat of an expanding Tokyo.','https://yattatachi.com/wp-content/uploads/2022/01/Pom_Poko-poster.jpg','2024-11-24T00:00:00+00:00');
INSERT INTO events VALUES('cm1uv47hw000g12gigf3ls4os','2024-10-04T15:10:42.165+00:00','2024-10-04T15:10:42.165+00:00','The Tale of Princess Kaguya (Studio Ghibli Fest 2024)','https://www.jdoqocy.com/click-9117960-10369449?url=https%3A%2F%2Fwww.fandango.com%2Fthe-tale-of-the-princess-kaguya-studio-ghibli-fest-2024-235298%2Fmovie-overview','Deep in the countryside, a man named Okina works as a bamboo cutter in a forest, chopping away at the hollow plants day after day. One day, he discovers a small baby inside a glowing shoot. He immediately takes her home, convinced that she is a princess sent to Earth as a divine blessing from heaven. Okina and his wife Ouna take it upon themselves to raise the infant as their own, watching over her as she quickly grows into an energetic young girl. Given the name Kaguya, she fits right in with the village she has come to call home, going on adventures with the other children and enjoying what youth has to offer.','https://yattatachi.com/wp-content/uploads/2024/03/The_Tale_of_the_Princess_Kaguya-512x768.webp','2024-11-25T00:00:00+00:00');
INSERT INTO events VALUES('cm1uv47l5000h12gii3t6hod9','2024-10-04T15:10:42.282+00:00','2024-10-04T15:10:42.282+00:00','My Neighbor Totoro (Studio Ghibli Fest 2024)','https://www.kqzyfj.com/click-9117960-10369449?url=https%3A%2F%2Fwww.fandango.com%2Fmy-neighbor-totoro-studio-ghibli-fest-2024-235299%2Fmovie-overview','In 1950s Japan, Tatsuo Kusakabe relocates himself and his two daughters, Satsuki and Mei, to the countryside to be closer to their mother, who is hospitalized due to long-term illness. As the girls grow acquainted with rural life, Mei encounters a small, bunny-like creature in the yard one day. Chasing it into the forest, she finds "Totoro"—a giant, mystical forest spirit whom she soon befriends. Before long, Satsuki too meets Totoro, and the two girls suddenly find their lives filled with magical adventures in nature and fantastical creatures of the woods.','https://yattatachi.com/wp-content/uploads/2019/02/My-Neighbor-Totoro-poster-508x768.jpg','2024-12-07T00:00:00+00:00');
